import react,{Component} from 'react'

import Recaptcha from 'react-google-recaptcha'

class Captcha extends Component{
render(){
    return(
       <Recaptcha
       sitekey='6LdB6XQaAAAAAFTOn3IpqLTHnoi2msKnRFxmwKog'
       onChange={onChange}
       />
    )
}
}
export default Captcha
